import { Col, Row } from "antd";
import styled from "styled-components";

import { ComponentFaceBookButton, ComponentGoogleButton, ComponentLineButton } from "@components";


interface IProps {
    socials:JSX.Element[];
}

export const ComponentSocialMedia = (props:IProps) => {
    //
    return (
        <StyledContainer>
            <Row gutter={8}>
                <Col span={8}>
                    <ComponentLineButton />
                </Col>
                <Col span={8}>
                    <ComponentFaceBookButton />
                </Col>
                <Col span={8}>
                    <ComponentGoogleButton />
                </Col>
            </Row>
        </StyledContainer>
    );
};

const StyledContainer = styled.div`
    padding: 42px 16px;
`;
